// src/pages/ReportsPage.jsx
import React from 'react';

function ReportsPage() {
  return (
    <div>
      <h2>Raporlar</h2>
      <p>Bu alanda sistem raporları ve istatistiksel özetler görüntülenecek.</p>
      <ul>
        <li>Aylık Trafik Raporu</li>
        <li>Bloklanan IP'ler Raporu</li>
        <li>Kaynak Bazlı Log Özetleri</li>
      </ul>
      <p>
        İlerleyen aşamalarda CSV/PDF çıktısı ve grafiksel gösterimler
        eklenecektir.
      </p>
    </div>
  );
}

export default ReportsPage;
